function submit_enroll() {

    var first_name = document.getElementById("firstName").value;
    var last_name = document.getElementById("lastName").value;
    var email_address = document.getElementById("email").value;

    if (first_name == "First name") {
        document.getElementById("firstName").value = "";
    }
    if (last_name == "Last name") {
        document.getElementById("lastName").value = "";
    }
    if (email_address == "Email") {
        document.getElementById("email").value = "";
    }

    if ((first_name != "" && first_name != "First Name") && (last_name != "" && last_name != "Last Name") && (email_address != "" && email_address != "Email")) {
        var s = s_gi(s_account);
        s.linkTrackVars = 'events';
        s.linkTrackEvents = 'event57';
        s.events = 'event57';
        s.tl(this, 'o', 'Completed SEF Click');
    }

    return true;
}


