/* Begin Mobile Sub Menu Flyouts - Upromise */

mobile_sub_nav_flyout_ = new Array();
mobile_sub_nav_flyout_[0] = "mobile_sub_nav_flyout_0";
mobile_sub_nav_flyout_[1] = "mobile_sub_nav_flyout_1";
mobile_sub_nav_flyout_[2] = "mobile_sub_nav_flyout_2";
mobile_sub_nav_flyout_[3] = "mobile_sub_nav_flyout_3";

if (document.getElementById("mobile_nav_flyout_left") != null || document.getElementById("mobile_nav_flyout_right") != null) {
TweenLite.to(document.getElementById("mobile_sub_nav_flyout_0"), 0, { x: "100%" }, { force3D: true, ease: Quad.easeInOut });
TweenLite.to(document.getElementById("mobile_sub_nav_flyout_1"), 0, { x: "100%" }, { force3D: true, ease: Quad.easeInOut });
TweenLite.to(document.getElementById("mobile_sub_nav_flyout_2"), 0, { x: "100%" }, { force3D: true, ease: Quad.easeInOut });
TweenLite.to(document.getElementById("mobile_sub_nav_flyout_3"), 0, { x: "100%" }, { force3D: true, ease: Quad.easeInOut });
}


function mobile_sub_menu(x) {
    var element = document.getElementById(x);
    var viewportmeta = document.querySelector('meta[name="viewport"]');
    window.scrollTo(0, 0);
    var animSpeed = 0;
    var activeToggleSpeed = 0;
    if (document.documentElement.clientWidth + $.scrollbarWidth() > 640) {
        animSpeed = .75;
        activeToggleSpeed = 800;
    }
    if (document.documentElement.clientWidth + $.scrollbarWidth() <= 640) {
        animSpeed = 1;
        activeToggleSpeed = 1050;
    }
    for (i = 0; i < mobile_sub_nav_flyout_.length; i++) {
        if (element.className.indexOf(" active") == -1 && x == "mobile_sub_nav_flyout_" + i) {
            element.className = element.className.replace(" inactive", " active");
            active_sub_menu = x;
            TweenLite.to(document.getElementById("mobile_sub_nav_flyout_" + i), animSpeed, { x: "0%" }, { force3D: true, ease: Quad.easeInOut });
            element.className = element.className.replace(" inactive", " active");
        }
    }
    window.focus(document.getElementById(active_sub_menu));
}


function mobile_sub_menu_close(x) {

    var element = document.getElementById(x);
    var viewportmeta = document.querySelector('meta[name="viewport"]');
    window.scrollTo(0, 0);
    var animSpeed = 0;
    var activeToggleSpeed = 0;
    if (document.documentElement.clientWidth + $.scrollbarWidth() > 640) {
        animSpeed = .75;
        activeToggleSpeed = 800;
    }
    if (document.documentElement.clientWidth + $.scrollbarWidth() <= 640) {
        animSpeed = 1;
        activeToggleSpeed = 1050;
    }
    for (i = 0; i < mobile_sub_nav_flyout_.length; i++) {
        if (element.className.indexOf(" active") != -1 && x == "mobile_sub_nav_flyout_" + i) {
            TweenLite.to(document.getElementById("mobile_sub_nav_flyout_" + i), animSpeed, { x: "100%" }, { force3D: true, ease: Quad.easeInOut });
            var t = setTimeout(function () {
                element.className = element.className.replace(" active", " inactive");
            }, activeToggleSpeed);
            active_sub_menu = "";
        }
    }
    window.focus(document.getElementById(active_sub_menu));

}

/* End Mobile Navigation Sub Menu Flyouts*/


/* Begin Contact Us Form Validation */

// field validations

function validateMessage() {

    var x = document.getElementById("msgmessage").value;

    if (x == null || x == "") {
        document.getElementById("msgmessage").style.border = '1px solid #ff4949';
        document.getElementById("message_error").style.display = 'block';
        document.getElementById("message_error").innerHTML = 'Oops. You forgot to enter a message.';
        return false;        
    } else {
        document.getElementById("msgmessage").style.border = '1px solid #dcdcdc';
        document.getElementById("message_error").style.display = "none";
        return true;
    }    
}

function validateEmail() {

    var x = document.getElementById("msgemail").value;
    var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
   
    if (re.test(x)) {
        document.getElementById("msgemail").style.border = '1px solid #dcdcdc';
        document.getElementById("email_error").style.display = "none";
        return true;
    } else {
        document.getElementById("msgemail").style.border = '1px solid #ff4949';
        document.getElementById("email_error").style.display = 'block';
        document.getElementById("email_error").innerHTML = "Hmm, that doesn't look right.";
        return false;
    }
}

// form validation 

function validateForm() {

    // Set error catcher
    var error = 0;

    // Validate Name
    if (!validateMessage('msgmessage')) {
        error++;
    }
    // Validate Email
    if (!validateEmail('msgemail')) {
        error++;
    }    
    // Don't submit form if there are errors
    if (error > 0) {        
        return false;
    }
    document.forms['UPContactForm'].submit();
    return true;
}

/* End Contact Us Form Validation */


/* Special Title for Contact Us*/

function specialTitle(x, y) {
    var selectMenu = document.getElementById(y)
    document.getElementById(x).innerHTML = selectMenu.options[selectMenu.selectedIndex].text.replace("*", "");
}

